import DropList from "../common-components/DropList";
import styles from "./settingsdroplist.module.css";

function SettingsDropList() {
  return (
    <DropList className={styles.settings_droptop}>
      <li className={styles.settings_li}>Settings</li>
      <li>
        <ul className={styles.settings_dropbottom}>

          <li>About</li>
          <li>Download the desktop app</li>
          <li>Download the mobile app</li>
        </ul>
      </li>
    </DropList>
  );
}

export default SettingsDropList;
